import React, { useState } from 'react';
import { motion } from 'framer-motion';

function App() {
  const [businessData, setBusinessData] = useState(null);
  const [formData, setFormData] = useState({
    businessName: '',
    location: ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    // Simulate API response
    setBusinessData({
      ...formData,
      rating: (4 + Math.random()).toFixed(1),
      reviews: Math.floor(Math.random() * 100) + 50,
      seoHeadline: 'Best-rated local business offering exceptional service in your area!'
    });
  };

  const handleInputChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const regenerateSEO = () => {
    setBusinessData(prev => ({
      ...prev,
      seoHeadline: `Top-rated ${prev.businessName} in ${prev.location} - Your trusted local business partner!`
    }));
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-50 py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-4xl mx-auto">
        <motion.h1
          initial={{ y: -20, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          className="text-4xl font-bold text-center text-gray-900 mb-12"
        >
          Business Dashboard
        </motion.h1>

        {!businessData ? (
          <motion.div
            initial={{ scale: 0.95, opacity: 0 }}
            animate={{ scale: 1, opacity: 1 }}
            className="bg-white rounded-xl shadow-lg p-6 mb-8 transform-3d card-hover"
          >
            <form onSubmit={handleSubmit} className="space-y-6">
              <div>
                <label htmlFor="businessName" className="block text-sm font-medium text-gray-700">
                  Business Name
                </label>
                <input
                  type="text"
                  name="businessName"
                  id="businessName"
                  required
                  value={formData.businessName}
                  onChange={handleInputChange}
                  className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
                  placeholder="Enter your business name"
                />
              </div>
              <div>
                <label htmlFor="location" className="block text-sm font-medium text-gray-700">
                  Location
                </label>
                <input
                  type="text"
                  name="location"
                  id="location"
                  required
                  value={formData.location}
                  onChange={handleInputChange}
                  className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
                  placeholder="Enter your business location"
                />
              </div>
              <motion.button
                whileHover={{ scale: 1.02 }}
                whileTap={{ scale: 0.98 }}
                type="submit"
                className="w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
              >
                View Dashboard
              </motion.button>
            </form>
          </motion.div>
        ) : (
          <div className="grid gap-6 md:grid-cols-2">
            <motion.div
              initial={{ x: -20, opacity: 0 }}
              animate={{ x: 0, opacity: 1 }}
              className="bg-white rounded-xl shadow-lg p-6 transform-3d card-hover"
            >
              <h2 className="text-xl font-semibold text-gray-900 mb-4">Business Overview</h2>
              <div className="space-y-4">
                <div>
                  <p className="text-sm text-gray-500">Business Name</p>
                  <p className="text-lg font-medium text-gray-900">{businessData.businessName}</p>
                </div>
                <div>
                  <p className="text-sm text-gray-500">Location</p>
                  <p className="text-lg font-medium text-gray-900">{businessData.location}</p>
                </div>
              </div>
            </motion.div>

            <motion.div
              initial={{ x: 20, opacity: 0 }}
              animate={{ x: 0, opacity: 1 }}
              className="bg-white rounded-xl shadow-lg p-6 transform-3d card-hover"
            >
              <h2 className="text-xl font-semibold text-gray-900 mb-4">Ratings & Reviews</h2>
              <div className="space-y-4">
                <div>
                  <p className="text-sm text-gray-500">Google Rating</p>
                  <p className="text-3xl font-bold text-yellow-500">{businessData.rating}★</p>
                </div>
                <div>
                  <p className="text-sm text-gray-500">Number of Reviews</p>
                  <p className="text-2xl font-semibold text-gray-900">{businessData.reviews}</p>
                </div>
              </div>
            </motion.div>

            <motion.div
              initial={{ y: 20, opacity: 0 }}
              animate={{ y: 0, opacity: 1 }}
              className="md:col-span-2 bg-white rounded-xl shadow-lg p-6 transform-3d card-hover"
            >
              <div className="flex justify-between items-start mb-4">
                <h2 className="text-xl font-semibold text-gray-900">AI-Generated SEO Headline</h2>
                <motion.button
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  onClick={regenerateSEO}
                  className="px-4 py-2 bg-green-500 text-white rounded-md shadow-sm hover:bg-green-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-green-500"
                >
                  Regenerate
                </motion.button>
              </div>
              <p className="text-lg text-gray-700 italic">"{businessData.seoHeadline}"</p>
            </motion.div>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
